// Récupérer les données de la facture
const invoice = $input.item.json;

// Récupérer le PDF en base64
const pdfBase64 = invoice.pdfBase64;

// Vérifier que le PDF existe
if (!pdfBase64) {
  throw new Error(`PDF manquant pour ${invoice.restaurantName || 'restaurant inconnu'}`);
}

// Retourner avec binary data pour Gmail
return {
  json: invoice,
  binary: {
    data: {
      data: pdfBase64,
      mimeType: 'application/pdf',
      fileName: invoice.filename || 'facture.pdf'
    }
  }
};
